import * as Dialog from '@radix-ui/react-dialog';

function CreateAdModal() {
    return(
        <Dialog.Portal>
            <Dialog.Overlay />

            <Dialog.Content>
                <Dialog.Title>Fazer uma reserva</Dialog.Title>
            </Dialog.Content>
        </Dialog.Portal>
    )
}

export default CreateAdModal
